import PropTypes from 'prop-types'

const Logo=({logo,text})=>{
      
    return( 
        <div >
            <img src='logo' />
            {text}
        </div>
    )
}

Logo.PropTypes={
    title:PropTypes.string,
    logo:PropTypes.string
}

Logo.defaultProps={
     title:"CORONA APP"
}

export default Logo
